See a #FlashingYellowArrow for a left turn?

@MassDOT has retrofitted 350+ traditional left turn signals to FYA since 2013. You'll see these typically placed over a left-turn lane. 

A #FlashingYellowArrow means YIELD to oncoming traffic &amp; pedestrians, then proceed with caution. https://t.co/d8Oah88xAR

